import React from 'react';
import { Link } from 'react-router-dom';

export const NavBar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/about">Home</Link>
                </li>
                <li>
                    <Link to="/login">Home</Link>
                </li>
            </ul>
        </nav>
    )
}
